  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Sherburne
  NWR outlines Refuge accomplishments during the 1982 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan,
  management planning, public participation, and research and investigations. Refuge
  administration is outlined; information about personnel, youth programs, manpower
  programs, volunteer programs, funding, safety, and technical assistance is given.
  Habitat management is also covered; subjects include wetlands, forests, croplands,
  grasslands, grazing, fire management, pest control, and wilderness areas. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries
  resources, scientific collections, and animal control. The public uses of the Refuge
  described in this report include outdoor classrooms, interpretive programs, hunting,
  fishing, wildlife observation, outdoor recreation, and law enforcement. The equipment
  and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment replacement, and energy conservation.
  Cooperative programs and items of interest are provided at the end.\",\n\t\"owner_org\":
